  $(".mask_tel_code").mask('+38(000)000-00-00', {clearIfNotMatch: true, placeholder: "+38(___)___-__-__"});

  // Работа с загруженными фото на первой форме
  $('.form-first .form__file input').change(function() {
    if ($(this).val() != '') {
      $(this).siblings("span").text('Выбрано файлов: ' + $(this)[0].files.length);
      $(".form-second .form__files_names").empty();
      $(".form-second .form__images_list").empty();
      $(".form-second .form__files").toggle("fast");
      $(".form-second .form__file").toggle("fast");
      for (var i = 0; i < $(this)[0].files.length; i++) {
        $(".form-second .form__files_names").append("<span>" + $(this)[0].files[i].name + "</span>");
      }
      var files = $(this)[0].files;
      for (var i = 0, f; f = files[i]; i++) {
        if (!f.type.match('image.*')) {
          continue;
        }
  
        var reader = new FileReader();
        reader.onload = (function(theFile) {
          return function(e) {
            var span = document.createElement('span');
            span.innerHTML = ['<img class="form__images_img" src="', e.target.result,
                              '" title="', escape(theFile.name), '"/>'].join('');
            $(".form-delete .form__images_list").append(span);
          };
        })(f);
        reader.readAsDataURL(f);
      }
      $(".form-delete").slideToggle("middle");
      $("." + $(".form-delete").attr("data-form")).slideToggle("middle");
    } else {
      $(this).siblings("span").text('Добавить файл');
      $(".form-second .form__files_names").empty();
    }
  });
